class List extends Component {

    constructor(props) {
        super(props);
        this.state = {
            dat:"Valores muy altos"
        }
    }

    render(){
        return (
            <Card>
              <CardHeader>
                Editar Grupos
              </CardHeader>
              <CardBody>
                <Col xs="10" md="10">
                    <InputGroup>
                        <Input type="select" name="status" id="status" key="status">
                           ...
                        </Input>
                        <InputGroupAddon addonType="append">

                        </InputGroupAddon>
                  </InputGroup>
                </Col>
                <Col xs="2" md="2">
                    hola mundo
                </Col>
              </CardBody>
            </Card>
        );
    }

}

export default(List)
